      SELECT ALL + ( + 74 ) - col0 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE ( NOT 31 NOT IN ( - 77, 34, + col1, + col0, - + 47, + col1 * + - 47 ) );
  - name: tab1

outputs:
  - name: q9244.out
    data: |
